// NoteList.js
import React from 'react';

const NoteList = () => {
  // Здесь вы можете получить данные о заметках пользователя
  // и отображать их в списке

  return (
    <div>
      <h1>Your Notes</h1>
      {/* Отображение списка заметок */}
      <ul>
        <li>Note 1</li>
        <li>Note 2</li>
        {/* Добавьте логику для отображения реальных заметок */}
      </ul>
    </div>
  );
};

export default NoteList;
